body:
In TensorrtExecutionProvider::GetCapability() method, the code
```
        if (input_shape) {
          for (auto dim : input_shape->dim()) {
            std::string dim_name = dim.dim_param();
            std::string exclude_dim_name1 = "NonZero";
            std::string exclude_dim_name2 = "NonMaxSuppression";
            if (!dim_name.empty()) {
              if ((dim_name.find(exclude_dim_name1) != std::string::npos) || (dim_name.find(exclude_dim_name2) != std::string::npos)) {
                exclude_node = true;
                LOGS(default_logger, INFO) << "exclude node " << node->name();
                break;
              }
            }
          }
        }
```
some input's shape is empty. So we exclude those node whose shape is empty using
```
        if (input_shape) {
          for (auto dim : input_shape->dim()) {
            std::string dim_name = dim.dim_param();
            std::string exclude_dim_name1 = "NonZero";
            std::string exclude_dim_name2 = "NonMaxSuppression";
            if (!dim_name.empty()) {
              if ((dim_name.find(exclude_dim_name1) != std::string::npos) || (dim_name.find(exclude_dim_name2) != std::string::npos)) {
                exclude_node = true;
                LOGS(default_logger, INFO) << "exclude node " << node->name();
                break;
              }
            }
          }
        } else {
          LOGS(default_logger, INFO) << "input->Shape() is 0 ";
          LOGS(default_logger, INFO) << "exclude node " << node->name();
          exclude_node = true;
          break;
        }
```
The above code can work. But some kernel fallback to CPU, and a lot of CPUs are comsumed.

If the input shape is fix, node placements is
```
